"""### DEF para criar a conex√£o e executar a consulta"""

def execute_query(host, user, password, database, query, df_name):
    try:
        # Criando a conex√£o com o banco de dados
        connection = mysql.connector.connect(
            host=host,
            user=user,
            password=password,
            database=database,
        )
    except mysql.connector.Error as err:
        print(f"Erro ao conectar ao banco de dados: {err}")
        return

    cursor = None  # Inicializando o cursor como None
    try:
        # Criando o cursor para apontar para o banco de dados
        cursor = connection.cursor()

        # Executando a consulta
        cursor.execute(query)

        # Armazenando os resultados na vari√°vel result
        result = cursor.fetchall()

        # Convertendo a vari√°vel result em um DataFrame pandas
        df = pd.DataFrame(result, columns=[i[0] for i in cursor.description])

        # Atribuindo o nome do DataFrame permitindo acessar fora da fun√ß√£o
        globals()[df_name] = df

        print(f"DataFrame '{df_name}' criado com sucesso.")

    except mysql.connector.Error as err:
        print(f"Erro ao executar a consulta: {err}")
    finally:
        # Fechando o cursor e a conex√£o
        if cursor is not None:
            cursor.close()
        connection.close()

