"""####Quais s√£o os Produtos que t√™m Maior Estimativa de Margem de Lucro?"""

'''
Quando n√£o se tem o custo do produto, voc√™ pode usar a seguinte f√≥rmula para estimar a margem de lucro m√≠nima:
Margem de Lucro M√≠nima (%) = [(Valor Total Vendido - Pre√ßo de Venda) / Valor Total Vendido] x 100
Essa f√≥rmula assume que todo o lucro √© proveniente da diferen√ßa entre o pre√ßo de venda e o custo do produto, ignorando outros custos operacionais.

'''
margem_lucro_minima = '''
SELECT
p.categoria,
(SUM(v.valor_total) - SUM(v.preco * v.quantidade)) / SUM(v.valor_total) * 100 AS margem_estimada
FROM Vendas as v
JOIN Produtos as p ON v.id_produto = p.id_produto
GROUP BY p.categoria
ORDER BY margem_estimada DESC;

'''
execute_query(host, user, password, database, margem_lucro_minima, 'margem_lucro_minima_df')
# Necess√°rio converter o tipo de dado decimal.Decimal para float para ter compatibilidade com o BigQuery
margem_lucro_minima_df['margem_estimada'] = margem_lucro_minima_df['margem_estimada'].astype(float)
display(margem_lucro_minima_df)

"""O resultado de 0% indica que, no pior caso, a margem de lucro seria zero, ou seja, todo o valor total vendido seria custo. Isso significa que, na realidade, a margem de lucro real deve ser maior que zero, pois existem outros custos al√©m do custo do produto."""

