"""####Qual √© o tempo m√©dio entre a primeira compra e a recompra?

"""

tempo_medio_compra = '''
SELECT
    id_cliente,
    CONCAT(round(AVG(tempo_entre_compras),1), " dias") AS tempo_medio_compra
FROM (
    SELECT
        id_cliente,
        DATEDIFF(data_venda, LAG(data_venda) OVER (PARTITION BY id_cliente ORDER BY data_venda)) AS tempo_entre_compras
    FROM
        Vendas
) AS subquery
WHERE
    tempo_entre_compras IS NOT NULL  -- Ignora valores nulos que podem ocorrer para o primeiro registro de cada cliente
GROUP BY
    id_cliente;

'''
execute_query(host, user, password, database, tempo_medio_compra, 'tempo_medio_compra_df')
display(tempo_medio_compra_df)

